import React, { useEffect } from 'react'
import axios from 'axios'
function Performance() {
const id=localStorage.getItem('id')

const date=new Date();
const day_1=date.setDate(date.getDate()-1).toISOString().split('T')[0]
const day_2=date.setDate(date.getDate()-2).toISOString().split('T')[0]
const day_3=date.setDate(date.getDate()-3).toISOString().split('T')[0]
const day_4=date.setDate(date.getDate()-4).toISOString().split('T')[0]
const day_5=date.setDate(date.getDate()-5).toISOString().split('T')[0]
const day_6=date.setDate(date.getDate()-6).toISOString().split('T')[0]
const day_7=date.setDate(date.getDate()-7).toISOString().split('T')[0]



console.log(day_1,day_2,day_3,day_4,day_5,day_6,day_7)
useEffect(()=>{
  axios.get(`http://localhost:8000/gettask/${id}`)
  .then(res=>console.log(res.data))
  
},[])


  return (
    <div>
      <h1>This is performance page</h1>
    </div>
  )
}

export default Performance
